  useEffect(() => {
    if (!localStorage.getItem("typee-user")) {
      navigate("/login");
    }
  }, []);

  return (
    <>
      <div className="chat-body">
        <div className="chat-container"></div>
      </div>
    </>
  );
}

export default Chat;
